@Test public void equals_differentBooleanParams_returnFalse() {
    // Given
    final boolean paramA = true;
    final boolean paramB = false;

    // When
    final boolean result = Objects.equals(paramA, paramB);

    // Then
    assertThat(result, is(false));
  }

